import React from 'react';
import './components.css'; // Adjust this import based on your actual CSS file name
import profileImage from '../../images/WhatsApp Image 2024-07-07 at 11.30.25_f41ee03c.jpg'; // Adjust the path if needed

const AboutMe = () => {
  return (
    <section id="aboutme">
      <div className="aboutme-container">
        <div className="image-container">
          <img src={profileImage} alt="Profile" className="profile-image" />
        </div>
        <div className="text-container">
          <p>Hello! I'm Benjamin Yew and this is my portfolio. I'm a passionate software developer with a knack for creating dynamic and user-friendly web applications. With a strong foundation in technologies like React, Node.js, and Sequelize, I thrive on solving complex problems and building innovative solutions.</p>
        </div>
      </div>
    </section>
  );
};

export default AboutMe;
